import React from 'react';
import {SafeAreaView, View, Text, Image, StyleSheet} from 'react-native';
import Logo from '../Img/logo.png';

export default function Load(){
    return (
        <SafeAreaView style={styles.containar}>
             <Image source={Logo} />
             
             <View style={styles.cardContainer}>
                <View style={styles.card}>
                    <Image source={{ uri: "https://avatars1.githubusercontent.com/u/32680891?v=4" }} />
                    <View style={styles.footer}>
                        <Text style={styles.name}>Luciano Costa</Text>
                        <Text style={styles.bio}>Aprendendo cada dia mais e mais.</Text>
                    </View>
                </View>
             </View>

             <View />
        </SafeAreaView>
    )
}

const styles = StyleSheet.create({
    containar: {
        flex: 1,
        backgroundColor: '#f5f5f5',
        alignItems: 'center',
        justifyContent: 'space-between'
    },
    cardContainer: {
        flex: 1,
        alineSelf: 'stretch',
        justifyContent: 'center',
        maxHeight: 500
    }
});
